import {Navbar, Nav, NavItem, NavDropdown, MenuItem, Container, Image} from 'react-bootstrap';

const NavigationBar = () => {
    return(
        <Navbar bg="light" expand="lg">
            <Container>
                <Image  src="https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png" fluid />
            </Container>
        </Navbar>
    );
}

export default NavigationBar;
